import React from "react";
import Accordian from "../Components/accordians";
import "./Services.css";

function Services() {
  return (
    <React.Fragment>
      <div className="d-md-flex justify-content-center">
        <div>
          <h2>Helloo...</h2>
        </div>
        <div className="d-md-flex accordian-div">
          <div>
            <Accordian />
          </div>
          <div>
            <Accordian />
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Services;
